import "./styles.css";

export default function App() {
  return (
    <div className="App">
      <h1>Burgernomics</h1>
      <h3>
      The big mac index was invented by The Economist in 1986 as a lighthearted guide to whether currencies are at their “correct” level. 
      It is based on the theory of purchasing-power parity (PPP).
      </h3>
      <h2>Click the AR logo and bring the burgers to life!</h2>
    </div>
  );
}
